class Running extends React.Component{
  constructor(props) {
    super(props);     
    const { dist } = useParams() 
    this.state={uploadProgress : dist}
  }


    render(){
      return <div className="App-main" >
                <br></br>                 
                <h1>The experience is running</h1><br></br><br></br><br></br>
                <ProgressBar variant="warning" animated now={this.state.uploadProgress} />
            </div>
      }


}   
export default Running;
